  true,\n\t\"url\": null,\n\t\"notes\": \"<p>1999-2014.  Centers for Disease Control
  and Prevention (CDC). State Tobacco Activities Tracking and Evaluation (STATE) System.
  \ YTS Data.  The YTS was developed to provide states with comprehensive data on
  both middle school and high school students regarding tobacco use, exposure to environmental
  tobacco smoke, smoking cessation, school curriculum, minors' ability to purchase
  or otherwise obtain tobacco products, knowledge and attitudes about tobacco, and
  familiarity with pro-tobacco and anti-tobacco media messages.  The YTS uses a two-stage
  cluster sample design to produce representative samples of students in middle schools
  (grades 6u00e2u0080u00938) and high schools (grades 9u00e2u0080u009312).  The data
  for the STATE System were extracted from Youth Tobacco Surveys from participating
  states.  Tobacco topics included are cigarette smoking prevalence, cigarette smoking
  frequency, smokeless tobacco products prevalence and quit attempts.</p>n\",\n\t\"license_title\":
